import React from 'react';
import axios from 'axios';  //npm add axios

const url = 'https://github.com/fivethirtyeight/data/blob/master/alcohol-consumption/drinks.csv';

function GetData(){
    axios.get(url)
    .then

    return(
        <div>
            <h1>Data</h1>
        </div>
       
    )
}
